const pdfHeader = {'Accept': 'application/pdf'};
export {csvHeader, pdfHeader};

export default function AccountResource({apiHandler}) {
    return {
        async signUp({data}) {
            return await apiHandler.post(`signup`, data, {authenticate: false});
        },

        async signIn({data}) {
            return await apiHandler.post(`signin`, data, {authenticate: false});
        },

        async activate({token}) {
            return await apiHandler.post(`activation/${token}`, null, {authenticate: false});
        },

        async forgotPassword({data}) {
            return await apiHandler.post(`forgot-password`, data, {authenticate: false});
        },

        async resetSandbox() {
            return await apiHandler.post(`reset-sandbox`);
        }
    };
};

export default function ApiKeysResource({apiHandler}) {
    return {
        async getAll({limit = null, offset = null, sort = null} = {}) {
            const params = {
                limit,
                offset,
                sort
            };
            return await apiHandler.getAll(`api-keys`, params);
        },

        async get({id}) {
            return await apiHandler.get(`api-keys/${id}`);
        },

        async create({id = '', data}) {
            return await apiHandler.create(`api-keys/${id}`, id, data);
        },

        async update({id, data}) {
            return await apiHandler.put(`api-keys/${id}`, data);
        },

        async delete({id}) {
            return await apiHandler.delete(`api-keys/${id}`);
        }
    };
};

